import React from 'react';
import { Button, useTheme } from '@mui/material';

const CreateNewEvent = () => {
    const theme = useTheme(); // 获取主题

    const handleCreateNewEvent = () => {
        console.log('Create New Event clicked');
        window.location.href = '/create-new-event';
    };

    return (
        <Button 
            color="primary" 
            variant="contained" 
            sx={{ 
                mr: 1,
                ':hover': {
                    boxShadow: `0 0 8px ${theme.palette.primary.main}`, // 鼠标悬停时添加阴影
                },
                fontWeight: 'bold', // 加粗文字
                padding: theme.spacing(1, 4), // 使用主题间距调整填充
            }} 
            onClick={handleCreateNewEvent}
        >
            Create New Event
        </Button>
    );
};

export default CreateNewEvent;
